        <h2>You Are Correct!</h2>
        <p>Way to go! It is an Indian meal moth, which is found in many types of pantry foods as well as processing and storage facilities. These insects are known to produce dense webbing that binds to food fragments. </p>
        <p>Continue learning more about different insects, treatment best practices and product benefits by completing the Bug Free Grains Training Module, an easy-to-follow guide designed to help protect your grains and profits from insect infestations. </p>
